function RightHistory(props: any) {
    console.log("history")
    var dateUnix=new Date().getTime();
    var temp:number =Math.round(dateUnix/1000);
    useEffect(() => {
        console.log("use effect called");
        axios
          .get(
            `https://api.openweathermap.org/data/2.5/onecall/timemachine?lat=${props.lat}&lon=${props.lon}&dt=${temp}&appid=a9c7a346f3196bdf3072d1b5efdb5a34`
          )
          .then((response) => {
            console.log(response);
          })
          .catch((error) => console.log(error));
      }, []);
